import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from '@material-ui/core/Button';

function App() {
  return (
    <div className="App">
      ButtonUI();
    </div>
  );
}

function ButtonUI()
{
  return (
    <Button variant="contained" color="primary">
       Hello World
    </Button>
  );
}



export default App;
